import itertools

def worst_case_payout(guesses):
    guesses = sorted(guesses)
    worst = float('inf')
    # Enumerate all allocations c1,c2,c3 nonnegative integers summing to 30 with a pair differ by 6
    allocations = []
    for c1 in range(31):
        for c2 in range(31-c1):
            c3 = 30 - c1 - c2
            cs = [c1,c2,c3]
            # constraint: one pair differs by 6
            ok = False
            for a,b in itertools.permutations(cs,2):
                if a == b + 6:
                    ok = True
                    break
            if not ok:
                continue
            # redundant constraint: at least one box has at least 2
            if max(cs) < 2:
                continue
            allocations.append(tuple(cs))
    # Deduplicate
    allocations = list(set(allocations))

    def min_payout_for_allocation(cs, guesses):
        # Host can permute mapping to minimize sum of guesses that fit
        worst = float('inf')
        for perm in set(itertools.permutations(cs)):
            payout = 0
            for g,c in zip(guesses,sorted(perm)): # careful: host can pair arbitrary; but we iterate all perms. But pairing guess order matters; we should consider host pairs guesses arbitrarily, so we should also permute guesses.
                pass
        # Actually to handle arbitrary assignments, iterate over permutations of mapping between guesses and cs.
        worst = float('inf')
        for perm_c in set(itertools.permutations(cs)):
            for perm_g in set(itertools.permutations(guesses)):
                payout = 0
                for g,c in zip(perm_g, perm_c):
                    payout += g if g <= c else 0
                worst = min(worst, payout)
        return worst

    for cs in allocations:
        w = min_payout_for_allocation(cs, guesses)
        worst = min(worst, w)
    return worst

best = (-1,None)
# Search guesses from 0..30 each. But sum of guesses cannot exceed 30 to be guaranteed maybe; but let's brute force limited.
for g1 in range(31):
    for g2 in range(g1,31):
        for g3 in range(g2,31):
            w = worst_case_payout((g1,g2,g3))
            if w > best[0]:
                best = (w,(g1,g2,g3))
print(best)

